import "./Todo.css";
import Todolist from "../todo-list/Todolist";
import TodoCreate from "../todo-create/Todo-create";

const Todo = () => {
  const todos = [
    {
      id: 1,
      title: "Learn React",
    },
    {
      id: 2,
      title: "Learn Together",
    },
    {
      id: 2,
      title: "Keep Studying",
    },
  ];

  return (
    <div className="App">
      <h3>Todo List</h3>
      {/* <TodoCreate /> */}
      <Todolist dataTodos={todos} />
    </div>
  );
};

export default Todo;
